import React, { useState, useEffect } from 'react';
import { Card, CardHeader, CardTitle, CardContent } from '@/components/ui/card';

const Climb = () => {
  const [climbs, setClimbs] = useState([]);
  const [isLoading, setIsLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchClimbs = async () => {
      try {
        const response = await fetch('/climbs');
        if (!response.ok) {
          throw new Error('Failed to fetch climbs');
        }
        const data = await response.json();
        setClimbs(data);
        setIsLoading(false);
      } catch (err) {
        setError(err.message);
        setIsLoading(false);
      }
    };

    fetchClimbs();
  }, []);

  if (isLoading) {
    return (
      <Card>
        <CardHeader>
          <CardTitle>Climbs</CardTitle>
        </CardHeader>
        <CardContent>
          <p>Loading climbs...</p>
        </CardContent>
      </Card>
    );
  }

  if (error) {
    return (
      <Card>
        <CardHeader>
          <CardTitle>Error</CardTitle>
        </CardHeader>
        <CardContent>
          <p>Error: {error}</p>
        </CardContent>
      </Card>
    );
  }

  return (
    <Card className="w-full max-w-4xl">
      <CardHeader>
        <CardTitle>Climbs</CardTitle>
      </CardHeader>
      <CardContent>
        {climbs.length === 0 ? (
          <p>No climbs found.</p>
        ) : (
          <table className="w-full border-collapse">
            <thead>
              <tr>
                {Object.keys(climbs[0]).map((key) => (
                  <th key={key} className="p-2 border text-left">
                    {key}
                  </th>
                ))}
              </tr>
            </thead>
            <tbody>
              {climbs.map((climb, index) => (
                <tr key={index} className="hover:bg-gray-100">
                  {Object.values(climb).map((value, colIndex) => (
                    <td key={colIndex} className="p-2 border">
                      {value}
                    </td>
                  ))}
                </tr>
              ))}
            </tbody>
          </table>
        )}
      </CardContent>
    </Card>
  );
};

export default Climb;
